import "./App.css";
import { useState } from "react";
export default function App() {
  const [page, setPage] = useState("About Me");
  function pageSetter() {}
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <header>
      <h1>Daniel Cross</h1>
      <Nav />
    </header>
  );
}

function Nav() {
  return (
    <nav>
      <ul>
        <li>About Me</li>
        <li>Portfolio</li>
        <li>Contact</li>
        <li>Resumé</li>
      </ul>
    </nav>
  );
}

function Project() {
  return (
    <div>
      <img src={"public/logo512.png"} alt="react-logo" />
    </div>
  );
}

function AboutMe() {
  return (
    <div>
      <h1>About Me</h1>
    </div>
  );
}
function Portfolio() {
  return (
    <div>
      <h1>Portfolio</h1>
    </div>
  );
}
function Contact() {
  return (
    <div>
      <h1>Contact</h1>
    </div>
  );
}
function Resume() {
  return (
    <div>
      <h1>Resumé</h1>
    </div>
  );
}
